import React, {Component} from 'react';
import Nav from "../components/Nav";
import Header from "../components/Header"

export default function Home() {
  return (
    <div className="Home">
      <Nav />
      <Header />
      <Mission />
      <Description />
      <Community />
      <Team />
      <Partners />
      <Prices />
      <Contact />
      <Footer />
    </div>
  )
}
